import { Breadcrumb } from 'antd';
export default function Bread(){
    return(
        <Breadcrumb>
            <Breadcrumb.Item>首页</Breadcrumb.Item>
            <Breadcrumb.Item>
                <a href="/list">Application Center</a>
            </Breadcrumb.Item>
            <Breadcrumb.Item>
                <a href="/means">修改资料</a>
            </Breadcrumb.Item>
            <Breadcrumb.Item>
                <a href="/edit">修改资料</a>
            </Breadcrumb.Item>
        </Breadcrumb>
    )

}
